import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const SuperAdminDashboard = ({ isLoggedIn }) => {
  const navigate = useNavigate();
  const [activeView, setActiveView] = useState('dashboard');
  const [stats, setStats] = useState({
    totalRequests: 0,
    completedRequests: 0,
    pendingRequests: 0,
    delayedRequests: 0,
    totalResidents: 0
  });
  const [delayedRequests, setDelayedRequests] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  // Simulate authentication redirect
  useEffect(() => {
    if (!isLoggedIn) {
      navigate('/superadmin');
    }
  }, [isLoggedIn, navigate]);

  // Simulate data loading
  useEffect(() => {
    const fetchData = async () => {
      // In a real app, these would be API calls
      setTimeout(() => {
        setStats({
          totalRequests: 1245,
          completedRequests: 932,
          pendingRequests: 213,
          delayedRequests: 64,
          totalResidents: 587
        });
        
        setDelayedRequests([
          { id: 'REQ-1001', resident: 'John Doe', expectedTime: '24 hours', delay: '12 hours' },
          { id: 'REQ-1002', resident: 'Jane Smith', expectedTime: '48 hours', delay: '5 hours' },
          { id: 'REQ-1003', resident: 'Robert Johnson', expectedTime: '24 hours', delay: '8 hours' }
        ]);
        
        setIsLoading(false);
      }, 1000);
    };

    fetchData();
  }, []);

  // Scenario 1: Redirect to dashboard after login
  if (!isLoggedIn) return null;

  return (
    <div className="super-admin-dashboard">
      <header className="dashboard-header">
        <h1>Super Admin Dashboard</h1>
        <nav className="dashboard-nav">
          <button 
            className={activeView === 'dashboard' ? 'active' : ''}
            onClick={() => setActiveView('dashboard')}
          >
            Dashboard
          </button>
          <button 
            className={activeView === 'reports' ? 'active' : ''}
            onClick={() => setActiveView('reports')}
          >
            View Reports
          </button>
          <button 
            className={activeView === 'residents' ? 'active' : ''}
            onClick={() => setActiveView('residents')}
          >
            Residents
          </button>
        </nav>
      </header>

      {isLoading ? (
        <div className="loading">Loading dashboard data...</div>
      ) : (
        <main className="dashboard-content">
          {/* Scenario 1: High-level analytics */}
          {activeView === 'dashboard' && (
            <div className="overview">
              <h2>Overview</h2>
              <div className="stats-grid">
                <div className="stat-card">
                  <h3>Total Requests</h3>
                  <p>{stats.totalRequests}</p>
                </div>
                <div className="stat-card">
                  <h3>Completed</h3>
                  <p>{stats.completedRequests}</p>
                </div>
                <div className="stat-card">
                  <h3>Pending</h3>
                  <p>{stats.pendingRequests}</p>
                </div>
                <div className="stat-card">
                  <h3>Delayed</h3>
                  <p>{stats.delayedRequests}</p>
                </div>
              </div>
              
              {/* Scenario 4: Residents count */}
              <div className="residents-summary">
                <h3>Registered Residents</h3>
                <p className="resident-count">{stats.totalResidents}</p>
              </div>
            </div>
          )}

          {/* Scenario 2: Request statistics */}
          {activeView === 'reports' && (
            <div className="reports-view">
              <h2>Request Reports</h2>
              <div className="request-summary">
                <h3>Request Statistics</h3>
                <div className="stats-grid">
                  <div className="stat-card">
                    <h4>Total Requests</h4>
                    <p>{stats.totalRequests}</p>
                  </div>
                  <div className="stat-card">
                    <h4>Completed</h4>
                    <p>{stats.completedRequests}</p>
                  </div>
                  <div className="stat-card">
                    <h4>Pending</h4>
                    <p>{stats.pendingRequests}</p>
                  </div>
                  <div className="stat-card">
                    <h4>Delayed</h4>
                    <p>{stats.delayedRequests}</p>
                  </div>
                </div>
              </div>

              {/* Scenario 3: Delayed requests */}
              <div className="delayed-requests">
                <h3>Delayed Requests</h3>
                <table>
                  <thead>
                    <tr>
                      <th>Request ID</th>
                      <th>Resident</th>
                      <th>Expected Time</th>
                      <th>Delay</th>
                    </tr>
                  </thead>
                  <tbody>
                    {delayedRequests.map(request => (
                      <tr key={request.id}>
                        <td>{request.id}</td>
                        <td>{request.resident}</td>
                        <td>{request.expectedTime}</td>
                        <td>{request.delay}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            </div>
          )}

          {/* Scenario 4: Residents view */}
          {activeView === 'residents' && (
            <div className="residents-view">
              <h2>Residents Information</h2>
              <div className="resident-stats">
                <h3>Total Registered Residents</h3>
                <p className="big-number">{stats.totalResidents}</p>
              </div>
            </div>
          )}
        </main>
      )}
    </div>
  );
};

export default SuperAdminDashboard;
